Hacía tiempo que un juego no me provocaba tantas emociones, empezando por la banda sonora y la historia en general y por la jugabilidad con diversas dinámicas usadas sobre todo en los años 90.

The Legend of Zelda: Link's Awakening es estéticamente increíble y se ve genial, sin a penas fallos, además, el estilo artístico le queda de maravilla a la historia y a la esencia del juego. 
Personalmente, una de las cosas que más me han llamado la atención y más me han gustado del juego son las referencias a otros títulos como Kirby y Mario Bros. 
Aunque seguramente lo que más me haya gustado es la edición especial física, creo que no la podrían haber hecho más bonita, tanto por lo que trae como por los colores y diseños que trae, aunque el cartucho del juego en mi opinión es bastante feo. . . 🎮 Mis compañeros: 
